import {useState, useEffect} from "react"

export const  Clock = () => {
	const [time, setTime] = useState(0)
    
	const incrementTime = () => setTime(new Date().toLocaleTimeString())
    
	const tick = () => {
	  setTimeout(() => {
	    incrementTime()
	    tick()
	  }, 1000)
	}
    
	useEffect(tick, [])
    
	return <h3>
		{time}
	</h3>
		
      }
